import React from "react";
import Navigation from "./navigation";
import ImageLink from "./imageLink";
import Footer from "./footer";
import Clarifai from "clarifai";

const app = new Clarifai.app({
  apiKey : '94979d2579454e5081d72cc4ea171e92'
})
function App() {
  function  imgLink(link) {
    app.mode.predict('94979d2579454e5081d72cc4ea171e92',link).then(
      function (res){
        console.log(res);

      },function (err){
        console.log('there was an error');
      }
    )
  }
  return (
    <div className="App">
      <Navigation />
      <ImageLink fetchImg={imgLink}/>
      <Footer />
      </div>
  );
}

export default App;
